package javalab;

public class swap {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a = 4;
		int b = 5;
		System.out.println("Before swapping");
		System.out.println(a);
		System.out.println(b);
		System.out.println("After swapping");
		int c;
		c=a;
		a=b;
		b=c;
		System.out.println(a);
		System.out.println(b);
		

	}

}
